import React from 'react';
import './App.css';
import Homepage from "./components/Homapage";
import Homebody from "./components/homebody";
import Department from "./components/department";
import Login from "./components/login";
import Registration from "./components/registration";
import ChangePass from "./components/change_pass";
import BookAppoinment from "./components/BookAppoinment";
import Prescription from "./components/prescription";
import Medicineshop from "./components/Medicineshop";
import { BrowserRouter as Router, Switch, Route } from 'react-router-dom';

function App() {
  return (
    <Router>
      <Homepage>
        <Switch>
          <Route path="/" exact component={Department} />
          <Route path="/medicine" exact component={Homebody} />
          <Route path="/login" component={Login} />
          <Route path="/registration" component={Registration} />
          <Route path="/changepass" component={ChangePass} />
          <Route path="/medicine" component={Medicineshop} />
          <Route path="/bookapoinment" component={BookAppoinment} />
          <Route path="/prescription" component={Prescription} />
        </Switch>

      </Homepage>
    </Router>
  );
}

export default App;
